import { Label, Menu, Tab } from 'semantic-ui-react';

import About from './About';
import Reviews from './Reviews';
import Photos from './Photos';


const ShowMenu = ({
  favorite,
  rate,
  doctor: {
    name,
    formatted_phone_number,
    formatted_address,
    rating,
    url,
    website,
  },
}) => {

}
const panes = [
  {
    menuItem: { key: 'about', icon: 'users', content: 'About' },
    render: () => (
      <Tab.Pane>
        <About favorite={favorite} rate={rate} doctor={doctor} />
      </Tab.Pane>
    ),
  },
  {
    menuItem: (
      <Menu.Item key='reviews' content='Reviews'>
        <Label>{reviews.length}</Label>
      </Menu.Item>
    ),
    render: () => (
      <Tab.Pane>
        <Reviews reviews={reviews} />
      </Tab.Pane>
    ),
  },
  {
    menuItem: (
      <Menu.Item key='photos' icon='image' content='Photos'>
        <Label>{photos.length}</Label>
      </Menu.Item>
    ),
    render: () => (
      <Tab.Pane>
        <Photos photos={photos} />
      </Tab.Pane>
    ),
  },
];
<Tab panes={panes} />;

export default ShowMenu;
